// 여기에 코드를 작성하세요
export async function getFoods({
  order = "createdAt",
  offset = 0,
  limit = 2,
  search = "",
}) {
  const query = `order=${order}&offset=${offset}&limit=${limit}&search=${search}`;
  const res = await fetch(`https://learn.codeit.kr/1111/foods?${query}`);
  if (!res.ok) {
    throw new Error("불려오기 실패");
  }
  const body = await res.json();
  return body;
}
